-- 查询滨海的
select t.BATCH_NO,
       t.TRAN_TYPE,
       t.TRAN_AMT,
       t.TRAN_AREA,
       t.SECT_ID,
       b.INFO_NAME as PROJECT_NAME,
       o.SUPER_ID  as DISTRICT_ID
from TRADE t
         join BASE_INFO b
              on t.SECT_ID = b.INFO_ID
         join OWNER_INFO o
              on b.INFO_ID = o.INFO_ID
where o.SUPER_ID in ('107', '108', '109', '119', '120', '121', '122', '125', '126')
  and o.SUPER_TYPE = '20'
  and t.TRAN_TYPE = 3110
order by BATCH_NO desc;
